func productExceptSelfAttempt2(nums []int) []int {
	fmt.Printf("nums = %v \n\n", nums)

	var preFinal []int
	for i := 0; i < len(nums); i++ {
		var temp []int
		temp = append(temp, nums[0:i]...)

		if i < len(nums)-1 {
			temp = append(temp, nums[i+1:]...)
		}

		preFinal = append(preFinal, temp...)
	}

	fmt.Printf("preFinal = %v \n\n", preFinal)

	var final []int
	acc := 1
	for i := 0; i < len(preFinal); i++ {
		if i != 0 && i%(len(nums)-1) == 0 {
			final = append(final, acc)
			acc = preFinal[i]
			continue
		}

		acc *= preFinal[i]
	}

	final = append(final, acc)

	fmt.Printf("final = %v \n\n", final)

	return final
}

